import { LOGIN_REQUEST } from './auth.types'
import axios from '../../helpers/axios'

export const login = (user) => async (dispatch) => {
  console.log(user)
  try {
    dispatch({
      type: LOGIN_REQUEST,
      payload: { user },
    })
    await axios.post('/admin/signin', { user })
  } catch (err) {
    console.log(err)
  }
}
